事故があったのは土佐市宮ノ内の市道です。警察と消防によりますと24日夜8時前、「トラックと建物の間に男性が挟まれている。意識と呼吸がない」と消防に通報がありました。
消防がかけつけると、近くに住む三宮浩さんが、トラックの運転席のドアに挟まれていて、その場で死亡が確認されました。
