殺人の罪に問われているのは岡山県和気町のパート従業員・藤井典子被告です。起訴状などによりますと藤井被告は昨年6月、実家の駐車場にとめた車の中で長男・蒼天くんの首をタオルで絞めて殺害した罪に問われています。

